  input: TEXT,F3A,,"This amendment is in response to the Commission's letter dated
    January 19, 2007.  The contribution from Jennifer Ewing Allen on 9/15/2006 was
    incorrectly reported as an in-kind for an event at her home.  Per CFR 100.77,
    an individual may spend up to $1000 per election for an in-home event. The amount
    in excess of the $1,000 limit has been reported as an in-kind to the Committee
    on Schedule A for Line 11(a)(i).  A duplicate contribution from Duke Talbott was
    mistakenly reported on 9/5/06.  It has been removed from this amendment. Other
    contributions received prior to the Primary Election from John Blair, Andrew Michael,
    Lyle Sattes, Lonnie Simmons, and Duke Talbott were originally mistakenly disclosed
    as General Election contributions.  Amended Pre-Primary and July Quarterly reports
    have been filed to correctly reflect the intended dates and elections. Updates
    to employer and occupation information have been included."
